import React, { Component } from "react";
import LoginPage from "../components/LoginPage/LoginPage";
import GreetingMessage from "../components/Greeting/GreetingMessage";

class Login extends Component {

  render() {
    return (
      <GreetingMessage/>,
      <LoginPage />
    );
  }
}

export default Login;
